import { useEffect,useState } from "react";
import axios from "axios";

export default function PersonFList(){
    const [usuarios,setUser] = useState([])
    const link2 = 'https://jsonplaceholder.typicode.com/users'

    useEffect(()=>{
        axios.get(link2).then(req=>{
            const dadosusuarios=req.data
            setUser(dadosusuarios)
        })
    })
    const detalhes=(props)=>{
        return(
            <div>
                <p>teste:{}</p>
                {usuarios.map((item,index)=>
                    <ul>
                        <li key={index}>Nome:{item.name}</li>
                        <li key={index}>Email:{item.email}</li>
                        <li key={index}>Telefone:{item.phone}</li>
                        <li key={index}>Site:{item.website}</li>
                    </ul>)}
            </div>
        )
    }
    return(
        <>
         <table>
            <tbody>
            <tr>
                <td>Nome</td>
                <td>Email</td>
                <td>Acao</td>
            </tr>
            {usuarios.map(item=>
                <tr>
                    <td>{item.name}</td>
                    <td>{item.email}</td>
                    <td><button onClick={detalhes}>Detalhes</button> <button>Excluir</button></td>
                </tr>
                )}
            </tbody>
        </table>
        </>
    )
}
